import React from 'react'
import { styles } from '../styles';
import { BsGithub, BsLinkedin } from 'react-icons/bs'

function formater(date){
    console.log('Two')
    const dateSplit = date.split(" ");
    console.log('Splitted Date: ', dateSplit)

    const year = dateSplit[3];
    const day = dateSplit[0];
    const dayNum = dateSplit[2];
    const month = dateSplit[1];


    return {
        day: day,
        dayNum: dayNum,
        year: year,
        month: month,
    }
}

export const NavBar = (props) => {
    const original_date = props.date.toString()
    console.log('One')
    const newDate = formater(original_date)

    // 9019015914


  return (
    <div style={styles.Container}>
        <div style={styles.dateContainer}>
            <h3 style={styles.dateSpace}>{newDate.dayNum}</h3>
            <h3 style={styles.dateSpace}>{newDate.day}</h3>
            <h3 style={styles.dateSpace}>{newDate.month}</h3>
            <h3 style={styles.dateSpace}>{newDate.year}</h3>
        </div>
        <div style={styles.buttonsContainer}>
            <a href='' style={styles.sideBarButtons}>About</a>
            <a href='' style={styles.sideBarButtons}>Resume</a>
            <a href='' style={styles.sideBarButtons}>Projects</a>

        </div>

        <div style={styles.linkedInGitContainer}>
            <div style={styles.GLIcons}>
                <BsGithub size={'4vh'} onClick={undefined}/>
            </div>
            <div style={styles.GLIcons}>
                <BsLinkedin size={'4vh'} onClick={undefined}/>
            </div>

        </div>
    </div>
  );
};


const navLinks = [
    {navLinkId: 'Home', scrollToId: 'homeContainer'}, // etc.
  ]

  const NavLink = ({ navLinkId, scrollToId, activeNavLinkId, setActiveNavLinkId }) => {
      const handleClick = () => {
          setActiveNavLinkId(navLinkId);
          document.getElementById(scrollToId).scrollIntoView({
              behavior: 'smooth', // gives an ease-in-out effect to our scroll
          });
      };

      return (
          <span 
               id={navLinkId} 
              className={activeNavLinkId === navLinkId ? 'activeClass' : ''} 
               onClick={handleClick}
          >
              {navLinkId}
          </span>
      );
  };
